(1, 'Web Developer', '', 'Y', NULL, '<p><strong>General</strong></p>\r\n\r\n<ol>\r\n	<li>Candidate must possess at least Diploma, Bachelor&#39;s Degree in any field.</li>\r\n	<li>At least 1 Year(s) of working experience in the related field is required for this position.</li>\r\n	<li>Required Skill(s): PHP, HTML, CSS</li>\r\n	<li>Preferably Staff (non-management &amp; non-supervisor) specialized in IT/Computer - Software or equivalent.</li>\r\n</ol>\r\n\r\n<p><strong>Requirements</strong></p>\r\n\r\n<ol>\r\n	<li>At least 1 years of experience in software development as Backend Engineer</li>\r\n	<li>Good experience Database Migration and Administration.</li>\r\n	<li>Have a good in MySQL, MongoDB.</li>\r\n	<li>Have a good PHP, HTML, Javascript Framework (Jquery/AngularJS) is a must.</li>\r\n	<li>Experienced use CodeIgniter/Laravel</li>\r\n	<li>Good knowledge on developing API and familiar with REST, JSON, etc.</li>\r\n	<li>Experienced with source code management (repository) like GIT is a plus.</li>\r\n	<li>Experienced with agile (SCRUM) software development is a plus.</li>\r\n	<li>Any application published is a big advantage</li>\r\n	<li>Willing to work in Jakarta and fulltime.</li>\r\n</ol>\r\n\r\n<ol>\r\n</ol>', '<ol>\r\n</ol>\r\n\r\n<p><strong>Responsibilities</strong></p>\r\n\r\n<ol>\r\n	<li>Design, develop, test and maintain highly scalable data infrastructure.</li>\r\n	<li>Discuss and solve problem with team.</li>\r\n	<li>Collaborates with other developer (team).</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Benefits</strong></p>\r\n\r\n<ul>\r\n	<li>Monday - Friday (8 hours/day)</li>\r\n	<li>Career developments</li>\r\n	<li>Competitive salary and Homey office</li>\r\n	<li>Allowance and health insurance</li>\r\n	<li>Cofee</li>\r\n	<li>Team building trip</li>\r\n	<li>Training and skill development</li>\r\n	<li>Full time position(s)</li>\r\n</ul>', '1 Year of Experience (Staff (non-management & non-supervisor))', 'fulltime', 'urgent', '2018-06-06 03:58:05'),
(2, 'React Native Developer', '', 'Y', NULL, '<p><strong>General</strong></p>\r\n\r\n<ul>\r\n	<li>Candidate must possess at least Bachelor/ Diploma</li>\r\n	<li>1 years work experience required.</li>\r\n	<li>Preferably Less than 1 year experience specialized in IT/Computer - Software or equivalent.</li>\r\n</ul>\r\n\r\n<p><strong>Requirements</strong></p>\r\n\r\n<ol>\r\n	<li>At least 1 years of experience in software development of mobile applications with react native programming.</li>\r\n	<li>Experienced with no-SQL and MongoDB</li>\r\n	<li>Good knowledge on developing API and familiar with REST, JSON, etc.</li>\r\n	<li>Have a good knowledge in Object Oriented Programming</li>\r\n	<li>Experienced with source code management (repository) like GIT is a plus.</li>\r\n	<li>Experienced with agile (SCRUM) software development is a plus.</li>\r\n	<li>Freshgraduates are welcome.</li>\r\n	<li>Any application published is a big advantage.</li>\r\n	<li>Willing to work in Yogyakarta and fulltime.</li>\r\n</ol>', '<p><strong>Responsibilities</strong></p>\r\n\r\n<ol>\r\n	<li>Design and develop mobile application with react native programming.</li>\r\n	<li>Develop application from existing framework</li>\r\n	<li>Adding features to existing applications</li>\r\n	<li>Debugging and fixing errors</li>\r\n	<li>Test application</li>\r\n	<li>Collaborate with other developers (team)</li>\r\n</ol>\r\n\r\n<p><strong>Benefits</strong></p>\r\n\r\n<ul>\r\n	<li>Career developments</li>\r\n	<li>Competitive salary and Homey office</li>\r\n	<li>Allowance and health insurance</li>\r\n	<li>Cofee</li>\r\n	<li>Fun room (bean bag, LED TV 40&rdquo;, Playstation 3)</li>\r\n	<li>Team building trip</li>\r\n	<li>Flexible working hours (8 hours)</li>\r\n	<li>Table tennis</li>\r\n	<li>Training and skill development</li>\r\n	<li>Full time position(s)</li>\r\n</ul>', '1 Year of Experience (Staff (non-management & non-supervisor))', 'fulltime', '', '2018-06-06 04:02:40'),
(4, 'Python Programmer Jakarta', '', 'Y', NULL, '<p><strong>General</strong></p><ul style=\"margin-left: 20px;\"><li>Candidate must possess at least Diploma, Bachelor&#39;s Degree in any field.</li><li>At least 1 Year(s) of working experience in the related field is required for this position.</li><li>Required Skill(s): Python, Flask, Django</li><li>Preferably Staff (non-management &amp; non-supervisor) specialized in IT/Computer - Software or equivalent.</li></ul><p><strong>Requirement</strong></p><ol style=\"margin-left: 20px;\"><li>At least 1 years of experience in software development as Backend Engineer</li><li>Good experience Database Migration and Administration.</li><li>Have a good Python is a must.</li><li>Have a good experience with Flask.</li><li>Preferable use Django.</li><li>Prefeareable with Linux Administration</li><li>Able to use Cloud Service (AWS, Azure)</li><li>Good knowledge on developing API and familiar with REST, JSON, etc.</li><li>Experienced with source code management (repository) like GIT is a plus.</li><li>Experienced with agile (SCRUM) software development is a plus.</li><li>Any application published is a big advantage</li><li>Willing to work in Jakarta and fulltime</li></ol>', '<p><strong>Responsibilities:</strong></p><ol style=\"margin-left: 20px;\"><li>Design, develop, test and maintain highly scalable data infrastructure.</li><li>Ensure data readiness for Analysis</li><li>Develop custom ETL</li><li>Develop crawling engine.</li><li>Discuss and solve problem with team.</li><li>Collaborates with other developer (team)</li></ol><p><strong>Requirement</strong></p><ul style=\"margin-left: 20px;\"><li>At least 1 years of experience in software development as Backend Engineer</li><li>Good experience Database Migration and Administration.</li><li>Have a good Python is a must.</li><li>Have a good experience with Flask.</li><li>Preferable use Django.</li><li>Prefeareable with Linux Administration</li><li>Able to use Cloud Service (AWS, Azure)</li><li>Good knowledge on developing API and familiar with REST, JSON, etc.</li><li>Experienced with source code management (repository) like GIT is a plus.</li><li>Experienced with agile (SCRUM) software development is a plus.</li><li>Any application published is a big advantage</li><li>Willing to work in Jakarta and fulltime</li></ul>', 'Min 1 tahun (Pegawai (non-manajemen & non-supervisor))', 'fulltime', '', '2018-06-06 04:09:46'),
(5, 'Django Programmer Jakarta', '', 'N', NULL, '<p><strong>General</strong></p>\r\n\r\n<ul>\r\n	<li>Candidate must possess at least Diploma, Bachelor&#39;s Degree in any field.</li>\r\n	<li>At least 1 Year(s) of working experience in the related field is required for this position.</li>\r\n	<li>Required Skill(s): Python, Flask, Django</li>\r\n	<li>Preferably Staff (non-management &amp; non-supervisor) specialized in IT/Computer - Software or equivalent.</li>\r\n</ul>\r\n\r\n<p><strong>Requirement</strong></p>\r\n\r\n<ol>\r\n	<li>At least 1 years of experience in software development as Backend Engineer</li>\r\n	<li>Good experience Database Migration and Administration.</li>\r\n	<li>Have a good Python is a must.</li>\r\n	<li>Have a good experience with Flask.</li>\r\n	<li>Have a good experience to use Django is a must.</li>\r\n	<li>Prefeareable with Linux Administration</li>\r\n	<li>Good knowledge on developing API and familiar with REST, JSON, etc.</li>\r\n	<li>Experienced with source code management (repository) like GIT is a plus.</li>\r\n	<li>Experienced with agile (SCRUM) software development is a plus.</li>\r\n	<li>Any application published is a big advantage</li>\r\n	<li>Willing to work in Jakarta and fulltime</li>\r\n</ol>', '<p><strong>Responsibilities:</strong></p>\r\n\r\n<ol>\r\n	<li>Design, develop, test and maintain highly scalable data infrastructure.</li>\r\n	<li>Ensure data readiness for Analysis</li>\r\n	<li>Develop custom ETL</li>\r\n	<li>Develop crawling engine.</li>\r\n	<li>Discuss and solve problem with team.</li>\r\n	<li>Collaborates with other developer (team)</li>\r\n</ol>\r\n\r\n<p><strong>Benefit :</strong></p>\r\n\r\n<ul>\r\n	<li>Monday - Friday (8 hours/day)</li>\r\n	<li>Career developments</li>\r\n	<li>Competitive salary and Homey office</li>\r\n	<li>Allowance and health insurance</li>\r\n	<li>Cofee</li>\r\n	<li>Team building trip</li>\r\n	<li>Training and skill development</li>\r\n</ul>', '1 Year of Experience (Staff (non-management & non-supervisor))', 'fulltime', '', '2018-06-06 04:12:49'),
(6, 'Android Hybrid Developer (Hybrid Mobile)', '', 'Y', NULL, '<p><strong>GENERAL</strong></p>\r\n\r\n<ul>\r\n	<li>Candidate must possess at least SMU, Bachelor&#39;s Degree&nbsp;in any field.</li>\r\n	<li>At least 1&nbsp;Year(s) of working experience in the related field is required for this position.</li>\r\n	<li>Preferably Less than 1 year experience specialized in IT/Computer - Software or equivalent.</li>\r\n</ul>\r\n\r\n<ol>\r\n</ol>\r\n\r\n<p><strong>Requirement:</strong></p>\r\n\r\n<ol>\r\n	<li>Experienced to develop mobile application (android and ios)</li>\r\n	<li>Experienced work with hybrid technology like C# Xamarin, Ionic, Cordova, Flutter etc.</li>\r\n	<li>Experienced with React Native Programming is a plus.</li>\r\n	<li>Good knowledge on developing API and familiar with REST, JSON, etc.</li>\r\n	<li>Experienced with 3rd party library.</li>\r\n	<li>Have a good knowledge in Object Oriented Programming</li>\r\n	<li>Experienced with source code management (repository) like GIT is a plus.</li>\r\n	<li>Experienced with agile (SCRUM) software development is a plus.</li>\r\n	<li>Any application published is a big advantage</li>\r\n	<li>Willing to work in Jakarta and fulltime</li>\r\n</ol>', '<p><strong>Responsibilities:</strong></p>\r\n\r\n<ol>\r\n	<li>Design and develop into two platforms (Android and/or IOS&nbsp;application).&nbsp;</li>\r\n	<li>Develop application from existing framework</li>\r\n	<li>Adding features to existing applications</li>\r\n	<li>Debugging and fixing errors</li>\r\n	<li>Test application</li>\r\n	<li>Collaborate with other developers (team)</li>\r\n</ol>\r\n\r\n<p><strong>Benefit :</strong></p>\r\n\r\n<ul>\r\n	<li>1 year contract</li>\r\n	<li>Career developments</li>\r\n	<li>Competitive salary</li>\r\n	<li>Allowance and health insurance</li>\r\n	<li>THR</li>\r\n	<li>Cofee</li>\r\n	<li>Team building trip</li>\r\n	<li>Training and skill development</li>\r\n	<li>Full time position(s)</li>\r\n</ul>', '1 Year of Experience (CEO/GM/Director/Senior Manager)', 'fulltime', '', '2018-08-27 06:43:47'),
(7, 'Front End Developer', '', 'Y', '<p><strong>General</strong></p>\r\n\r\n<ul>\r\n	<li>At least 1&nbsp;Year(s) of working experience in the related field is required for this position.</li>\r\n	<li>Required Skill(s): AngularJS, HTML, CSS, PHP, MySQL, JavaScript</li>\r\n	<li>Preferably Less than 1 year experience specialized in IT/Computer - Software or equivalent.</li>\r\n</ul>', '<p><strong>Requirement</strong></p>\r\n\r\n<ol>\r\n	<li>At least 1 years of experience in software development as Front End Developer</li>\r\n	<li>Must have knowledge AngularJS (prefer version 6)</li>\r\n	<li>Strong Knowledge of web standards and protocols, including: HTML, CSS, PHP, MySQL and JavaScript Framework (Jquery, AJAX, etc)</li>\r\n	<li>Have a good experience in UI / UX Design</li>\r\n	<li>Detail-oriented.</li>\r\n	<li>Passionate on design.</li>\r\n	<li>Freshgraduate are welcome.</li>\r\n	<li>Any application published is a big advantage</li>\r\n	<li>Willing to work in Jakarta or Yogyakarta fulltime.</li>\r\n</ol>', '<p><strong>Responsibilities:</strong></p>\r\n\r\n<ol>\r\n	<li>Review project requirement and provide recommendations as needed</li>\r\n	<li>Delivering the result according the schedule with good quality</li>\r\n	<li>Pro-actively report progress to Project Manager / Product Owner</li>\r\n</ol>\r\n\r\n<p><strong>Benefit :</strong></p>\r\n\r\n<ul>\r\n	<li>Monday - Friday (8 hours/day)</li>\r\n	<li>Career developments</li>\r\n	<li>Competitive salary and Homey office</li>\r\n	<li>Allowance and health insurance</li>\r\n	<li>Cofee, snack, and kitchen</li>\r\n	<li>Team building trip</li>\r\n	<li>Training and skill development</li>\r\n	<li>Funroom : PES 3, LED 40 INCH, Table Tennis, etc</li>\r\n	<li>Full time position(s)</li>\r\n</ul>\r\n\r\n<ol>\r\n</ol>', '1 Year of Experience (Less Than 1 year of experience)', 'fulltime', 'urgent', '2018-08-27 07:08:44'),
(9, 'Business Development ', '', 'Y', NULL, '<p><strong>Kualifikasi :</strong></p>\r\n\r\n<ul>\r\n	<li>Usia maksimal 30 tahun</li>\r\n	<li>Pendidikan minimal D3</li>\r\n	<li>Komunikatif dan cekatan</li>\r\n	<li>Dapat berbahasa inggirs aktif tulisan maupun lisan</li>\r\n	<li>Technolgy enthusiast</li>\r\n	<li>Pernah berpengalaman menjadi business development/telemarketing menjadi nilai plus</li>\r\n	<li>Bersedia ditempatkan di Yogjakarta</li>\r\n</ul>', '<p><strong>Deskripsi pekerjaan :</strong></p>\r\n\r\n<ul>\r\n	<li>Menggembangkan bisnis perusahaan dengan kegiatan business development berupa lead, telepon, sosial media, email, dan komunikasi lainnya</li>\r\n	<li>Mencari dan mengupdate database leads di seluruh Indonesia</li>\r\n	<li>Melakukan support terhadap project manager dan management perusahaan</li>\r\n	<li>Melakukan support terhadap kegiatan - kegiatan business development</li>\r\n	<li>Melakukan penjadwalan meeting project antar perusahaan.</li>\r\n	<li>Memberikan informasi perusahaan kepada partners dan clients</li>\r\n	<li>Membuat analisa pasar dan strategi</li>\r\n	<li>Membangun dan menjalin hubungan baik dengan clients dan partners</li>\r\n</ul>\r\n\r\n<p>Benefit :</p>\r\n\r\n<ul>\r\n	<li>Hari kerja Senin - Jumat</li>\r\n	<li>Jam masuk fleksibel (toleransi jam 8 - 10 pagi)</li>\r\n	<li>Asuransi kesehatan, THR</li>\r\n	<li>Kopi dan fun room (PS 3, LED TV)</li>\r\n	<li>Jenjang karir</li>\r\n</ul>', '1 Year of Experience (Staff (non-management & non-supervisor))', 'fulltime', '', '2018-08-27 07:26:18'),
(10, 'Java Developer (Web Developer)', '', 'Y', '<p><strong>General Requirement</strong></p>\r\n\r\n<ul>\r\n	<li>Candidate must possess at least Diploma, Bachelor&#39;s Degree&nbsp;in any field.</li>\r\n	<li>At least 1&nbsp;Year(s) of working experience in the related field is required for this position.</li>\r\n	<li>Required Skill(s): ITILJava/J2EE, Java, Spring</li>\r\n	<li>Preferably Staff (non-management &amp; non-supervisor) specialized in IT/Computer - Software or equivalent.</li>\r\n</ul>', NULL, '<p><strong>Benefit :</strong></p>\r\n\r\n<ul>\r\n	<li>Monday - Friday (8 hours/day)</li>\r\n	<li>Career developments</li>\r\n	<li>Competitive salary and Homey office</li>\r\n	<li>Allowance and health insurance</li>\r\n	<li>Cofee, snack, and kitchen</li>\r\n	<li>Team building trip</li>\r\n	<li>Training and skill development</li>\r\n	<li>Funroom : PES 3, LED 40 INCH, Table Tennis, etc</li>\r\n	<li>Full time position(s)</li>\r\n</ul>', '1 Year of Experience (CEO/GM/Director/Senior Manager)', 'fulltime', '', '2018-08-27 07:34:35'),
(11, 'Angular Frontend Developer', '', 'Y', '<p><strong>General</strong></p>\r\n\r\n<ul>\r\n	<li>Candidate must possess at least Diploma, Bachelor&#39;s Degree&nbsp;in any field.</li>\r\n	<li>At least 2&nbsp;Year(s) of working experience in the related field is required for this position.</li>\r\n	<li>Required Skill(s): HTML, CSS, Angular, AngularJS, SaaS, JavaScript</li>\r\n	<li>Preferably Staff (non-management &amp; non-supervisor) specialized in IT/Computer - Software or equivalent.</li>\r\n</ul>', '<p><strong>Requirement</strong></p>\r\n\r\n<ol>\r\n	<li>At least 1 years of experience in software development as Front End Developer</li>\r\n	<li>Must have knowledge AngularJS (prefer Angular CLI version 6)</li>\r\n	<li>Strong Knowledge of web standards and protocols, including: HTML, CSS, PHP, MySQL and JavaScript Framework (Jquery, AJAX, etc)</li>\r\n	<li>Have a good experience in UI / UX Design</li>\r\n	<li>Detail-oriented.</li>\r\n	<li>Passionate on design.</li>\r\n	<li>Good communication in English: written and oral</li>\r\n	<li>Must have portfolios</li>\r\n	<li>Any application published is a big advantage</li>\r\n	<li>Willing to work in Jakarta or Yogyakarta fulltime.</li>\r\n</ol>', '<p><strong>Responsibilities:</strong></p>\r\n\r\n<ol>\r\n	<li>Review project requirement and provide recommendations as needed</li>\r\n	<li>Delivering the result according the schedule with good quality</li>\r\n	<li>Pro-actively report progress to Project Manager / Product Owner</li>\r\n</ol>\r\n\r\n<p><strong>Benefit :</strong></p>\r\n\r\n<ul>\r\n	<li>Monday - Friday (8 hours/day)</li>\r\n	<li>Career developments</li>\r\n	<li>Competitive salary and Homey office</li>\r\n	<li>Allowance and health insurance</li>\r\n	<li>Cofee, snack, and kitchen</li>\r\n	<li>Team building trip</li>\r\n	<li>Training and skill development</li>\r\n	<li>Funroom : PES 3, LED 40 INCH, Table Tennis, etc</li>\r\n	<li>Full time position(s)</li>\r\n</ul>', '2 Years of Experience (CEO/GM/Director/Senior Manager)', 'fulltime', '', '2018-08-27 08:13:10'),
(12, 'Android Developer', '', 'Y', NULL, '<p><strong>Requirement :</strong></p>\r\n\r\n<ul>\r\n	<li>Experienced with native Android Development</li>\r\n	<li>Experienced with Android SDK</li>\r\n	<li>Experienced with remote data&nbsp;by REST and JSON</li>\r\n	<li>Experienced with 3rd party library&nbsp;and&nbsp;API</li>\r\n	<li>Experienced with no-SQL database</li>\r\n	<li>One or two published apps in Play Store will be an advantage</li>\r\n	<li>Willing to work in Yogyakarta (fulltime)</li>\r\n</ul>', '<p><strong>Job responsibilities :</strong></p>\r\n\r\n<ul>\r\n	<li>Develop application from existing framework.</li>\r\n	<li>Discuss and solve problems with team.</li>\r\n	<li>Adding features to existing applications.</li>\r\n	<li>Fix errors</li>\r\n	<li>Testing of applications and services.</li>\r\n	<li>Work on bug fixing and improving application performance</li>\r\n</ul>\r\n\r\n<p><strong>Benefit :</strong></p>\r\n\r\n<ul>\r\n	<li>Career developments</li>\r\n	<li>Competitive salary and Homey office</li>\r\n	<li>Allowance and health insurance</li>\r\n	<li>Cofee</li>\r\n	<li>Fun room (bean bag, LED TV 40&rdquo;, Playstation 3)</li>\r\n	<li>Team building trip</li>\r\n	<li>Flexible working hours (8 hours)</li>\r\n	<li>Training and skill development</li>\r\n	<li>Entertainment monthly</li>\r\n</ul>', '1 Year of Experience (Staff (non-management & non-supervisor))', 'fulltime', 'urgent', '2018-08-27 09:35:19'),
(13, 'Project Manager', '', 'Y', NULL, '<p><strong>Kualifikasi :</strong></p>\r\n\r\n<ol>\r\n	<li>Berpengalaman dalam dunia programming dan software development.</li>\r\n	<li>Menguasai project management: mencari dan berkomunikasi dengan leads/client, dealing project, membuat dokumentasi requirement system, dll</li>\r\n	<li>Terbiasa membuat proposal project, scope project dan timeline.</li>\r\n	<li>Mampu mengontrol kinerja team melalui Project Leader.</li>\r\n	<li>Memonitor dan evaluasi progress/laporan perkembangan project agar sesuai target dan timeline.</li>\r\n	<li>Mampu berkomunikasi dan presentasi dengan baik kepada client.</li>\r\n	<li>Secara default tidak ikut serta dalam development (aktivitas coding)</li>\r\n	<li>Bersedia ditempatkan dan bekerja di kantor Yogyakarta.</li>\r\n	<li>Bekerja fulltime (Senin - Jum&#39;at).</li>\r\n</ol>', '<p><strong>Benefit :</strong></p>\r\n\r\n<ol>\r\n	<li>Salary negotiable dan bonus project (insentive dealing)</li>\r\n	<li>Hari kerja Senin - Jumat, 8 jam kerja (jam masuk fleksibel)</li>\r\n	<li>Building trip</li>\r\n	<li>Tunjangan kesehatan, THR, bonus KPI</li>\r\n	<li>Jenjang karir</li>\r\n	<li>Kopi, funroom, snack</li>\r\n</ol>', '1 Year of Experience (Manager/Assistant Manager)', 'fulltime', '', '2018-08-27 09:37:44'),
(14, 'IOS Developer', '', 'Y', NULL, '<p><strong>Requirement:</strong></p>\r\n\r\n<ul>\r\n	<li>Experienced in IOS mobile development with Objective-C or SWIFT</li>\r\n	<li>Good knowledge in analysis and object-oriented programming</li>\r\n	<li>Experienced with Xcode &amp; XML</li>\r\n	<li>Experienced with ofline storage, memory and performance tuning</li>\r\n	<li>Understanding of Apple&#39;s design principles and interface guidelines</li>\r\n	<li>Experienced with RESTful APIs and JSON to connect IOS application to backend services</li>\r\n	<li>Familiriaty with cloud message APIs and push notification</li>\r\n	<li>Knowledge of UI/UX standards</li>\r\n	<li>Experience sourcecode management like GIT is a plus&nbsp;</li>\r\n	<li>Experienced with agile (SCRUM) software development is a plus</li>\r\n	<li>Any application published in Apple Store is a big advantage</li>\r\n	<li>Willing to work in Jakarta fulltime</li>\r\n</ul>', '<p><strong>Benefit:</strong></p>\r\n\r\n<ul>\r\n	<li>Provided iMac&nbsp;</li>\r\n	<li>Career developments</li>\r\n	<li>Competitive salary and Homey office</li>\r\n	<li>Allowance and health insurance</li>\r\n	<li>Cofee and snack</li>\r\n	<li>Team building trip</li>\r\n	<li>Flexible working hours (8 hours)</li>\r\n	<li>Training and skill development</li>\r\n	<li>Full time position(s)</li>\r\n</ul>', '1 Year of Experience (Staff (non-management & non-supervisor))', 'fulltime', 'urgent', '2018-08-27 09:39:34'),
(15, 'Quality Assurance (Software Testing)', '', 'Y', '<p><strong>GENERAL</strong></p>\r\n\r\n<ul>\r\n	<li>Candidate must possess at least Bachelor&#39;s Degree in Computer Science/Information Technology or equivalent.</li>\r\n	<li>Required language(s):&nbsp;Bahasa Indonesia, English</li>\r\n	<li>At least 1&nbsp;Year(s) of working experience in the related field is required for this position.</li>\r\n	<li>Required Skill(s): Agile, Pentest, Test Case</li>\r\n	<li>Preferably Staff (non-management &amp; non-supervisor) specialized in Quality Control/Assurance or equivalent.</li>\r\n</ul>', '<p><strong>REQUIREMENT</strong></p>\r\n\r\n<ul>\r\n	<li>Bachelor&rsquo;s degree in Computer Science, Software Engineering or a related area is preferred.</li>\r\n	<li>More than 1 year working experience in software testing.</li>\r\n	<li>Good in English (Oral and Written)</li>\r\n	<li>Experience working process with agile, scrum .</li>\r\n	<li>Experience of using bug tracking systems like JIRA.</li>\r\n	<li>Experience of testing desktop application, website, web application, mobile application.</li>\r\n	<li>Knowledge of QA testing and defect tracking software.</li>\r\n	<li>Knowledge of making test cases/test procedures.</li>\r\n	<li>Able to work both independently and as part of a team.</li>\r\n	<li>Having experiences of Mobile application testing is an advantage</li>\r\n	<li>Personal skills: team-work, willing to learn, proactive.</li>\r\n</ul>', '<p><strong>RESPONSIBILITIES</strong></p>\r\n\r\n<ul>\r\n	<li>Analyze the software requirements, design requirements to determine the test requirements of the project.</li>\r\n	<li>Create test cases/specs (test conditions, test scripts, actions, input data and expected results) on ( Android / IOS ) / Web / PC.</li>\r\n	<li>Update testing documents (test plans, test cases &hellip;) following the changing of requirements.</li>\r\n	<li>Review, test products before delivering.</li>\r\n	<li>Work with developers to analyze and find the root of bugs.</li>\r\n	<li>Good teamworks, will collaborate with our Vietnam Team</li>\r\n</ul>', '1 Year of Experience (Staff (non-management & non-supervisor))', 'fulltime', '', '2018-08-27 09:42:34'),
(16, 'Senior Java Developer (Web Developer)', '', 'Y', NULL, '<p><strong>Requirement:</strong></p>\r\n\r\n<ol>\r\n	<li>At least 2 years of experience in software development of Java applications</li>\r\n	<li>Experienced with Java framework like J2EE, Spring, Struts, Spring, Hibernate &nbsp;Framework.</li>\r\n	<li>Familiar use AngularJS</li>\r\n	<li>Good knowledge on developing API and familiar with REST, JSON, etc.</li>\r\n	<li>Experienced with source code management (repository) like GIT is a plus.</li>\r\n	<li>Experienced with agile (SCRUM) software development is a plus.</li>\r\n	<li>Any application published is a big advantage</li>\r\n	<li>Good in English (oral and written)</li>\r\n	<li>Willing to work in Yogyakarta and fulltime</li>\r\n</ol>', '<p><strong>Responsibilities:</strong></p>\r\n\r\n<ol>\r\n	<li>Design and develop application from existing framework</li>\r\n	<li>Adding features to existing applications.</li>\r\n	<li>Debuging and fixing errors.</li>\r\n	<li>Testing of applications and services.</li>\r\n	<li>Discuss and solve problem with team.</li>\r\n	<li>Collaborates with other developer (team) especially our Vientam Team</li>\r\n</ol>', '2 Years of Experience (Staff (non-management & non-supervisor))', 'fulltime', 'urgent', '2018-08-27 09:44:21'),
(17, 'Senior Fullstack Web Developer', '', 'Y', '<p><strong>General</strong></p>\r\n\r\n<ul>\r\n	<li>Candidate must possess at least Diploma, Bachelor&#39;s Degree&nbsp;in any field.</li>\r\n	<li>At least 1&nbsp;Year(s) of working experience in the related field is required for this position.</li>\r\n	<li>Required Skill(s): JavaScript, PHP, Java, JSON API, Angular JS.</li>\r\n	<li>Preferably Less than 1 year experience specialized in IT/Computer - Software or equivalent.</li>\r\n</ul>', '<p><strong>Requirement</strong></p>\r\n\r\n<ol>\r\n	<li>At least 1 years of experience in software development based on website.</li>\r\n	<li>Have experience as Fullstack Developer\r\n	<ul>\r\n		<li>Frontend framework Javascript like AngularJS, Jquery, etc.</li>\r\n		<li>Backend framework like PHP Framework (Laravel/CI/etc) or Java Spring.</li>\r\n	</ul>\r\n	</li>\r\n	<li>Good knowledge on developing API and familiar with REST, JSON, etc.</li>\r\n	<li>Experienced with source code management (repository) like GIT is a plus.</li>\r\n	<li>Experienced with agile (SCRUM) software development is a plus.</li>\r\n	<li>Any application published is a big advantage</li>\r\n	<li>Willing to work in Yogyakarta and fulltime</li>\r\n</ol>', '<p><strong>Responsibilities:</strong></p>\r\n\r\n<ol>\r\n	<li>Design and develop application from existing framework</li>\r\n	<li>Adding features to existing applications.</li>\r\n	<li>Debuging and fixing errors.</li>\r\n	<li>Testing of applications and services.</li>\r\n	<li>Discuss and solve problem with team.</li>\r\n	<li>Collaborates with other developer (team) especially with our Vietnam Team</li>\r\n</ol>', '2 Years of Experience (Staff (non-management & non-supervisor))', 'fulltime', '', '2018-08-27 09:45:22'),
(18, 'Senior Android Developer', '', 'Y', NULL, '<p><strong>Requirement :</strong></p>\r\n\r\n<ul>\r\n	<li>Good teamwork, will collaborate with our Vietnam Team</li>\r\n	<li>Experienced with native Android Development</li>\r\n	<li>Experienced with Android SDK</li>\r\n	<li>Experienced with remote data&nbsp;by REST and JSON</li>\r\n	<li>Experienced with 3rd party library&nbsp;and&nbsp;API</li>\r\n	<li>One or two published apps in Play Store will be an advantage</li>\r\n	<li>Good in English (Oral and Written)</li>\r\n	<li>Willing to work in Yogyakarta (fulltime)</li>\r\n</ul>', '<p><strong>Responsibilities :</strong></p>\r\n\r\n<ul>\r\n	<li>Develop application from existing framework.</li>\r\n	<li>Discuss and solve problems with team.</li>\r\n	<li>Adding features to existing applications.</li>\r\n	<li>Fix errors</li>\r\n	<li>Testing of applications and services.</li>\r\n	<li>Work on bug fixing and improving application performance</li>\r\n</ul>\r\n\r\n<p><strong>Benefit :</strong></p>\r\n\r\n<ul>\r\n	<li>Career developments</li>\r\n	<li>Competitive salary and Homey office</li>\r\n	<li>Allowance and health insurance</li>\r\n	<li>Cofee</li>\r\n	<li>Fun room (bean bag, LED TV 40&rdquo;, Playstation 3</li>\r\n	<li>Team building trip</li>\r\n	<li>Flexible working hours (8 hours)</li>\r\n	<li>Training and skill development</li>\r\n	<li>Full time position(s)</li>\r\n</ul>', '2 Years of Experience (CEO/GM/Director/Senior Manager)', 'fulltime', 'urgent', '2018-08-27 09:50:33'),
(19, 'Senior IOS Developer', '', 'Y', NULL, '<p><strong>Requirement:</strong></p>\r\n\r\n<ul>\r\n	<li>Good teamwork, will collaborate with our Vietnam Team</li>\r\n	<li>Experienced in IOS mobile development with Objective-C or SWIFT</li>\r\n	<li>Good knowledge in analysis and object-oriented programming</li>\r\n	<li>Experienced with RESTful APIs and JSON to connect IOS application to backend services</li>\r\n	<li>Familiriaty with cloud message APIs and push notification</li>\r\n	<li>Experience sourcecode management like GIT is a plus&nbsp;</li>\r\n	<li>Experienced with agile (SCRUM) software development is a plus</li>\r\n	<li>Any application published in Apple Store is a big advantage</li>\r\n	<li>Good in English (oral and written)</li>\r\n	<li>Willing to work in Yogyakarta fulltime</li>\r\n</ul>', '<p><strong>Benefit:</strong></p>\r\n\r\n<ul>\r\n	<li>Career developments</li>\r\n	<li>Competitive salary and Homey office</li>\r\n	<li>Allowance and health insurance</li>\r\n	<li>Cofee and snack</li>\r\n	<li>Team building trip</li>\r\n	<li>Flexible working hours (8 hours)</li>\r\n	<li>Training and skill development</li>\r\n	<li>Full time position(s)</li>\r\n</ul>', '2 Years of Experience (Staff (non-management & non-supervisor))', 'fulltime', 'urgent', '2018-08-27 09:52:08'),
(20, 'Junior General Affair (GA)', '', 'Y', '<p><strong>TANGGUNGJAWAB</strong></p>\r\n\r\n<ul>\r\n	<li>Bertanggungjawab terhadap urusan operasional kantor seperti penyediaan, pengadaan dan perawatan fasilitas kantor.</li>\r\n	<li>Bertanggungjawab dalam pemberkasan dokumen, penataan, dan urusan administrasi perusahaan.</li>\r\n	<li>Bekerja sesuai arahan dan melaporkan pekerjaan kepada Kepala Divisi HRGA dan Manager Perusahaan.</li>\r\n	<li>Wajib bekerja secara professional dan bertanggungjawab.</li>\r\n</ul>\r\n\r\n<p><strong>SYARAT KUALIFIKASI</strong></p>\r\n\r\n<ul>\r\n	<li>Kandidat maksimal berumur 23, Diutamakan Wanita dan belum berkeluarga.</li>\r\n	<li>Minimal lulusan D1 / D3 / Sederajat, S1 / D4 / Sederajat.</li>\r\n	<li>Siap bekerja secepatnya dan tahan tekanan.</li>\r\n	<li>Punya pengalaman berorganisasi selama di sekolah.</li>\r\n	<li>Punya kendaraan dan SIM C.</li>\r\n	<li>Punya device/laptop pribadi.</li>\r\n	<li>Terbiasa bekerja dengan social media, internet, google drive document.</li>\r\n	<li>Mempunya komunikasi yang bagus, good listener, aktif dan sopan santun.</li>\r\n	<li>Menyukai tantangan bekerja di perusahaan IT (tentang teknis).</li>\r\n	<li>Paham priority management.</li>\r\n	<li>Punya kerjasama tim bagus, mempunyai semangat tinggi, dan prinsip saling menghormati.</li>\r\n	<li>Bersedia untuk dibentuk menjadi professional worker dan diberikan challenge.</li>\r\n	<li>Diutamakan yang mau tinggal di kantor.</li>\r\n	<li>Freshgraduate are welcome</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n</ul>', '<p><strong>BENEFIT</strong></p>\r\n\r\n<ul>\r\n	<li>Career developments</li>\r\n	<li>Competitive salary and Homey office</li>\r\n	<li>Allowance and health insurance</li>\r\n	<li>Coffee</li>\r\n	<li>Fun room (bean bag, LED TV 40&rdquo;, Playstation 3)</li>\r\n	<li>Team building trip</li>\r\n	<li>Table Tennis</li>\r\n	<li>Flexible working hours (8 hours)</li>\r\n	<li>Training and skill development</li>\r\n</ul>', NULL, '1 Year of Experience (Less Than 1 year of experience)', 'fulltime', '', '2018-09-13 06:26:51'),
(21, 'Android Developer', '', 'Y', '<p><strong>Job responsibilities :</strong></p>\r\n\r\n<ul>\r\n	<li>Develop application from existing framework.</li>\r\n	<li>Discuss and solve problems with team.</li>\r\n	<li>Adding features to existing applications.</li>\r\n	<li>Fix errors</li>\r\n	<li>Testing of applications and services.</li>\r\n	<li>Work on bug fixing and improving application performance</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n</ul>', '<p><strong>Requirement :</strong></p>\r\n\r\n<ul>\r\n	<li>Experienced with native Android Development</li>\r\n	<li>Experienced with Android SDK</li>\r\n	<li>Experienced with remote data&nbsp;by REST and JSON</li>\r\n	<li>Experienced with 3rd party library&nbsp;and&nbsp;API</li>\r\n	<li>Experienced with no-SQL database</li>\r\n	<li>&nbsp;Experienced with mobile hybrid programming (react native/kotlin/cordova)</li>\r\n	<li>One or two published apps in Play Store will be an advantage</li>\r\n	<li>Willing to work in Jakarta (fulltime)</li>\r\n</ul>', '<p><strong>Requirement :</strong></p>\r\n\r\n<ul>\r\n	<li>Experienced with native Android Development</li>\r\n	<li>Experienced with Android SDK</li>\r\n	<li>Experienced with remote data&nbsp;by REST and JSON</li>\r\n	<li>Experienced with 3rd party library&nbsp;and&nbsp;API</li>\r\n	<li>Experienced with no-SQL database</li>\r\n	<li>&nbsp;Experienced with mobile hybrid programming (react native/kotlin/cordova)</li>\r\n	<li>One or two published apps in Play Store will be an advantage</li>\r\n	<li>Willing to work in Jakarta (fulltime)</li>\r\n</ul>\r\n\r\n<p><strong>Benefit :</strong></p>\r\n\r\n<ul>\r\n	<li>Career developments</li>\r\n	<li>Competitive salary and Homey office</li>\r\n	<li>Allowance and health insurance</li>\r\n	<li>Cofee</li>\r\n	<li>Team building trip</li>\r\n	<li>Training and skill development</li>\r\n	<li>Full time position(s)</li>\r\n</ul>', '1 Year of Experience (Staff (non-management & non-supervisor))', 'fulltime', 'urgent', '2018-09-13 09:37:09'),
(22, 'Technical Writer', '', 'Y', '<p><strong>Tugas dan Tanggung Jawab :</strong></p>\r\n\r\n<ul>\r\n	<li>Membuat dokumentasi development dan user guide</li>\r\n	<li>Membuat dan menyusun test script/scenario testing (SIT atau UAT).</li>\r\n	<li>Membuat dan menyusun BRD (Business Requirement Document) dan FSD (Functional Specification Document)</li>\r\n</ul>', '<p><strong>Kualifikasi :</strong></p>\r\n\r\n<ul>\r\n	<li>Lulusan D3/S1 Teknik Informatika/Ilmu Komputer/Teknik Komputer</li>\r\n	<li>Pengalaman minimun 1 tahun.</li>\r\n	<li>Terbiasa menulis dan mendokumentasikan software development</li>\r\n	<li>Paham format dokumentasi.</li>\r\n	<li>Mempunyai kemampuan analisis sistem, membuat UML, user guide,rancangan database, MoM dll&nbsp;</li>\r\n	<li>Terbiasa implementasi metode pengembangan software (SDLC, Agile, dll)</li>\r\n	<li>Memiliki latar belakang bahasa pemrograman (misal: PHP/Java/SQL/HTML/ dll)</li>\r\n	<li>Bekerja secara aktif dan detail.</li>\r\n	<li>Dapat bekerja secara tim.</li>\r\n	<li>Bersedia Bekerja di Kantor Yogyakarta</li>\r\n</ul>', NULL, '1 Year of Experience (Staff (non-management & non-supervisor))', 'fulltime', '', '2018-09-14 11:35:14'),
(23, 'Web Developer (Laravel)', '', 'Y', '<p><strong>General</strong><br />\r\nCandidate must possess at least Diploma, Bachelor&#39;s Degree in any field.<br />\r\nAt least 1 Year(s) of working experience in the related field is required for this position.<br />\r\nRequired Skill(s): PHP Framework CodeIgniter/CI, HTML, CSS, REST API<br />\r\nPreferably Staff (non-management &amp; non-supervisor) specialized in IT/Computer - Software or equivalent.<br />\r\n&nbsp;</p>', '<p>Requirement<br />\r\nAt least 1 years of experience in software development as Backend Engineer<br />\r\nGood experience Artsisan, Database Migration and Administration.<br />\r\nHave a good in MySQL/MariaDB.<br />\r\nHave a good PHP, HTML, Javascript Framework (Jquery/AngularJS) is a must.<br />\r\nExperienced use Laravel<br />\r\nGood knowledge on developing API and familiar with JSON and/or XML<br />\r\nExperienced with source code management (repository) like GIT is a plus.<br />\r\nExperienced with agile (SCRUM) software development is a plus.<br />\r\nAny application published is a big advantage<br />\r\nWilling to work in Yogyakarta and fulltime</p>', '<p>Responsibilities:<br />\r\nDesign, develop, test and maintain highly scalable data infrastructure.<br />\r\nDiscuss and solve problem with team.<br />\r\nCollaborates with other developer (team)<br />\r\n<br />\r\nBenefit :<br />\r\nMonday - Friday (8 hours/day)<br />\r\nCareer developments<br />\r\nCompetitive salary and Homey office<br />\r\nAllowance and health insurance<br />\r\nCofee<br />\r\nTable Tennis, Funroom (TV LED 40 inchi, PES 3, Dart, etc)<br />\r\nTeam building trip<br />\r\nTraining and skill development<br />\r\nFull time position(s)</p>', '1 Year of Experience (Staff (non-management & non-supervisor))', 'fulltime', 'urgent', '2018-09-19 07:13:40'),
(24, 'Database Engineer', '', 'Y', '<p>General understanding of routine maintenance, recovery, and handling database failover<br />\r\nFamiliarity whit the main data manipulation language and database design principles<br />\r\nUnderstanding of information laws (Data protection act, etc)<br />\r\nUnderstand the concept of NoSQL or Big Data knowledge is a plus and preferred<br />\r\nAre motivated and self-lead, and want to be part of an awesome team<br />\r\nYou are able to communicate clearly in a team<br />\r\nFull time position(s)<br />\r\n&nbsp;</p>', '<p>Strong knowledge of databases, database design, and relational database<br />\r\nStrong knowledge of RDBMS (ex : MySQL, SQL Server, Oracle)<br />\r\nStrong knowledge of SQL query, store procedure, and performance tuning</p>', '<p>Benefit :</p>\r\n\r\n<p>Career Developments<br />\r\nCompetitive Sallary and Homey Office<br />\r\nAllowance and health insurance<br />\r\nCoffee, snack and kitchen<br />\r\nFun Office (fun room, PS3, table tennis, dart, cart, etc)<br />\r\nTeam building trip<br />\r\nTraining and skill development<br />\r\nExciting start-up work culture surrounded by great people from various backgrounds<br />\r\nFree bus</p>', '3 Years of Experience (Staff (non-management & non-supervisor))', 'fulltime', '', '2018-11-06 10:29:02'),
(25, 'Ruby on Rails Developer', '', 'Y', '<p>&nbsp;</p>\r\n\r\n<ul>\r\n</ul>', '<p><strong>Requirement :</strong></p>\r\n\r\n<ul>\r\n	<li>Hands on experience and strong proficiency in Ruby and Ruby on Rails web application development framework</li>\r\n	<li>At least 2 years of experience in software development of Ruby and Ruby on Rails</li>\r\n	<li>Interested to work in exiting creative industry</li>\r\n	<li>Are motivated and self-lead, and want to be part of an awesome team</li>\r\n	<li>You are able to communicate clearly in a team</li>\r\n	<li>Full time position(s)</li>\r\n</ul>', '<p><strong>Job responsibilities :</strong></p>\r\n\r\n<ul>\r\n	<li>Build, and maintain efficient, reusable, and reliable Ruby code Integration of user-facing elements developed by front-end developers with server side logic</li>\r\n	<li>Identify bottlenecks and bugs, and devise solutions to these problems Help maintain code quality, organization and automatization</li>\r\n</ul>\r\n\r\n<p><strong>Benefit :</strong></p>\r\n\r\n<ul>\r\n	<li>Career developments</li>\r\n	<li>Competitive salary and Homey office</li>\r\n	<li>Allowance and health insurance</li>\r\n	<li>Cofee, Snack, and kitchen</li>\r\n	<li>Fun Office (fun room, PS3, table tennis, dart, cart, etc)</li>\r\n	<li>Team building trip</li>\r\n	<li>Training and skill development</li>\r\n	<li>Exciting start-up work culture surrounded by great people from various backgrounds</li>\r\n</ul>', '2 Years of Experience (Staff (non-management & non-supervisor))', 'fulltime', '', '2018-11-08 02:21:17'),
(26, 'Personal Assistant', '', 'Y', '<ul>\r\n	<li>Max. 25 years old</li>\r\n	<li>Female, preferably not hijab</li>\r\n	<li>Attractive appearance</li>\r\n	<li>Min. Diploma Degree (D3) any major</li>\r\n	<li>At least 1 or 2 years of working experience &nbsp;Personal Assisstant</li>\r\n</ul>', '<ul>\r\n	<li>Flexibility and adaptability</li>\r\n	<li>Good oral and written communication skills both English &amp; Indonesia (Mandarin would be a plus)</li>\r\n	<li>The ability to be proactive and take the initiative</li>\r\n	<li>Communication skills</li>\r\n	<li>Able to work overtime and under pressure</li>\r\n	<li>Good Communication, highly integrity, honest, commited &amp; responsible person</li>\r\n</ul>', '<ul>\r\n	<li>Acting as a first point of contact: dealing with correspondence and phone calls</li>\r\n	<li>Organising meetings and appointments with clients</li>\r\n	<li>Make daily and weekly tasks</li>\r\n	<li>Booking and arranging travel, transport and accommodation</li>\r\n	<li>Organising events and conferences</li>\r\n	<li>Typing, compiling and preparing reports, presentations and correspondence</li>\r\n</ul>', '2 Years of Experience (Staff (non-management & non-supervisor))', 'fulltime', '', '2018-12-17 09:18:32'),
(27, 'Fullstack Javascript', '', 'Y', '<p><strong>General</strong></p>\r\n\r\n<ol>\r\n	<li>Candidate must possess at least Diploma, Bachelor&#39;s Degree&nbsp;in any field.</li>\r\n	<li>At least 1&nbsp;Year(s) of working experience in the related field is required for this position.</li>\r\n	<li>Required Skill(s): JavaScript, react, redux, angular, mongoDB, express, nodeJS</li>\r\n	<li>Preferably Less than 1 year experience specialized in IT/Computer - Software or equivalent.</li>\r\n</ol>', '<p><strong>Requirement</strong></p>\r\n\r\n<ol>\r\n	<li>At least 1 years of experience in software development of Javascript technology.</li>\r\n	<li>Have experience use Javascript framework.&nbsp;\r\n	<ul>\r\n		<li>Frontend framework like AngularJS/ReactJS/KnockoutJS, etc.</li>\r\n		<li>Backend framework like nodeJS/ExpressJS/VueJS, etc.</li>\r\n	</ul>\r\n	</li>\r\n	<li>Familiar with unit testing like Jest, Mocha is a plus.</li>\r\n	<li>Experienced with No-SQL, MongoDB</li>\r\n	<li>Good knowledge on developing API and familiar with REST, JSON, etc.</li>\r\n	<li>Experienced with source code management (repository) like GIT is a plus.</li>\r\n	<li>Experienced with agile (SCRUM) software development is a plus.</li>\r\n	<li>Any application published is a big advantage</li>\r\n	<li>Willing to work in Yogyakarta and fulltime</li>\r\n</ol>', '<p><strong>Responsibilities:</strong></p>\r\n\r\n<ol>\r\n	<li>Design and develop application from existing framework</li>\r\n	<li>Adding features to existing applications.</li>\r\n	<li>Debuging and fixing errors.</li>\r\n	<li>Testing of applications and services.</li>\r\n	<li>Discuss and solve problem with team.</li>\r\n	<li>Collaborates with other developer (team)</li>\r\n</ol>\r\n\r\n<p><strong>Benefit :</strong></p>\r\n\r\n<ul>\r\n	<li>Career developments</li>\r\n	<li>Competitive salary and Homey office</li>\r\n	<li>Allowance and health insurance</li>\r\n	<li>Cofee</li>\r\n	<li>Fun room (bean bag, LED TV 40&rdquo;, Playstation 3)</li>\r\n	<li>Team building trip</li>\r\n	<li>Flexible working hours (8 hours)</li>\r\n	<li>Table tennis</li>\r\n	<li>Training and skill development</li>\r\n	<li>Full time position(s)</li>\r\n</ul>', '1 Year of Experience (Staff (non-management & non-supervisor))', 'fulltime', '', '2019-02-04 06:41:59'),
(28, 'Senior C# Developer', '', 'Y', '<ul>\r\n	<li>Candidate must possess at least Bachelor&#39;s Degree&nbsp;in any field.</li>\r\n	<li>At least 3&nbsp;Year(s) of working experience in the related field is required for this position.</li>\r\n	<li>Required Skill(s): C#, .NET</li>\r\n	<li>Preferably Manager/Assistant Manager specialized in IT/Computer - Software or equivalent.</li>\r\n</ul>', '<p><strong>Requirement :</strong></p>\r\n\r\n<ol>\r\n	<li>Experienced minimum 3 years in a related position.</li>\r\n	<li>Experienced with C# or .NET</li>\r\n	<li>Experienced with remote data&nbsp;by REST and JSON</li>\r\n	<li>Experienced with 3rd party library&nbsp;and&nbsp;API</li>\r\n	<li>Willing to work in Yogyakarta (fulltime)</li>\r\n</ol>', '<p><strong>Job responsibilities :</strong></p>\r\n\r\n<ol>\r\n	<li>Develop application from existing framework.</li>\r\n	<li>Discuss and solve problems with team.</li>\r\n	<li>Adding features to existing applications.</li>\r\n	<li>Fix errors</li>\r\n	<li>Testing of applications and services.</li>\r\n	<li>Work on bug fixing and improving application performance</li>\r\n	<li>Integration API with another application</li>\r\n</ol>\r\n\r\n<p><strong>Benefit :</strong></p>\r\n\r\n<ul>\r\n	<li>Career developments</li>\r\n	<li>Competitive salary and Homey office</li>\r\n	<li>Allowance and health insurance</li>\r\n	<li>Cofee</li>\r\n	<li>Team building trip</li>\r\n	<li>Training and skill development</li>\r\n	<li>Full time position(s)</li>\r\n</ul>', '3 Years of Experience (Staff (non-management & non-supervisor))', 'fulltime', '', '2019-02-04 06:57:54'),
