(30, 'Backend Developer', '', 'Y', '<ul>\r\n	<li>Candidate must possess at least SMU, Diploma, Bachelor&#39;s Degree&nbsp;in any field.</li>\r\n	<li>At least 1&nbsp;Year(s) of working experience in the related field is required for this position.</li>\r\n	<li>Required Skill(s): PHP, ITILJava/J2EE, HTML, CSS, AJAX, JavaScript</li>\r\n	<li>Preferably Staff (non-management &amp; non-supervisor) specialized in IT/Computer - Software or equivalent.</li>\r\n</ul>', '<p><strong>Requirement:</strong></p>\r\n\r\n<ol>\r\n	<li>At least 1 years of experience in software development of Java applications</li>\r\n	<li>Experienced as Backend Developer</li>\r\n	<li>Experienced with Java Framework, PHP Framework (Laravel/CI/etc).</li>\r\n	<li>Experienced with MySQL/PostgreSQL/SQL Server.</li>\r\n	<li>Good knowledge on developing API and familiar with REST, JSON, etc.</li>\r\n	<li>Have a good knowledge in Object Oriented Programming</li>\r\n	<li>Experienced with source code management (repository) like GIT is a plus.</li>\r\n	<li>Experienced with agile (SCRUM) software development is a plus.</li>\r\n	<li>Any application published is a big advantage</li>\r\n	<li>Willing to work in Jakarta and&nbsp;fulltime</li>\r\n</ol>', '<p><strong>Responsibilities:</strong></p>\r\n\r\n<ol>\r\n	<li>Design and develop application from existing framework</li>\r\n	<li>Adding features to existing applications.</li>\r\n	<li>Debuging and fixing errors.</li>\r\n	<li>Testing of applications and services.</li>\r\n	<li>Discuss and solve problem with team.</li>\r\n	<li>Collaborates with other developer (team)</li>\r\n</ol>\r\n\r\n<p><strong>Benefit :</strong></p>\r\n\r\n<ul>\r\n	<li>Monday - Friday (8 hours/day)</li>\r\n	<li>Career developments</li>\r\n	<li>Competitive salary and Homey office</li>\r\n	<li>Allowance and health insurance</li>\r\n	<li>Cofee</li>\r\n	<li>Team building trip</li>\r\n	<li>Training and skill development</li>\r\n	<li>PES 3 LED 40 INCHI, Table Tennis</li>\r\n	<li>Full time position(s)</l