(31, 'Backend Engineer', '', 'Y', '<ul>\r\n	<li>Candidate must possess at least Diploma, Bachelor&#39;s Degree&nbsp;in any field.</li>\r\n	<li>At least 1&nbsp;Year(s) of working experience in the related field is required for this position.</li>\r\n	<li>Required Skill(s): Python, Java, Go</li>\r\n	<li>Preferably Staff (non-management &amp; non-supervisor) specialized in IT/Computer - Software or equivalent.</li>\r\n</ul>', '<p><strong>Requirement</strong></p>\r\n\r\n<ol>\r\n	<li>At least 1 years of experience in software development as Backend Engineer</li>\r\n	<li>Good experience Database Migration and Administration.</li>\r\n	<li>Have a good in MySQL, MongoDB, Solr, Elasticsearch (one of them or more is a plus).</li>\r\n	<li>Have a good Python, Java or GoLang (one of them or more) is a must.</li>\r\n	<li>Prefeareable with Linux Administration</li>\r\n	<li>Able to use Cloud Service (AWS, Azure)</li>\r\n	<li>Good knowledge on developing API and familiar with REST, JSON, etc.</li>\r\n	<li>Experienced with source code management (repository) like GIT is a plus.</li>\r\n	<li>Experienced with agile (SCRUM) software development is a plus.</li>\r\n	<li>Any application published is a big advantage</li>\r\n	<li>Willing to work in Jakarta and fulltime</li>\r\n</ol>', '<p><strong>Responsibilities:</strong></p>\r\n\r\n<ol>\r\n	<li>Design, develop, test and maintain highly scalable data infrastructure.</li>\r\n	<li>Ensure data readiness for Analysis</li>\r\n	<li>Develop custom ETL</li>\r\n	<li>Develop crawling engine.</li>\r\n	<li>Discuss and solve problem with team.</li>\r\n	<li>Collaborates with other developer (team)</li>\r\n</ol>\r\n\r\n<p><strong>Benefit :</strong></p>\r\n\r\n<ul>\r\n	<li>Monday - Friday (8 hours/day)</li>\r\n	<li>Career developments</li>\r\n	<li>Competitive salary and Homey office</li>\r\n	<li>Allowance and health insurance</li>\r\n	<li>Cofee</li>\r\n	<li>Team building trip</li>\r\n	<li>Training and skill development</li>\r\n	<li>PES 3 LED 40 INCHI, Table Tennis</li>\r\n	<li>Full time position(s)</li>\r\n</ul>', '1 Year of Experience (Staff (non-management & non-supervisor))', 'fulltime', '', '2019-02-04 07:08:34'),
(32, 'Project Director', '', 'Y', NULL, '<ul>\r\n	<li>Candidate must possess at least Diploma, Bachelor&#39;s Degree, Master&#39;s Degree/Post Graduate Degree&nbsp;in any field.</li>\r\n	<li>At least 2&nbsp;Year(s) of working experience in the related field is required for this position.</li>\r\n	<li>Required Skill(s): PHP, JavaScript, java, MySQL, PostgreSQL MongoDB, SQL Server, IoS, Android, Teamwork, HTML, C#</li>\r\n	<li>Preferably Supervisor/Coordinator specialized in IT/Computer - Software or equivalent.</li>\r\n</ul>', '<p><strong>Benefit :</strong></p>\r\n\r\n<ul>\r\n	<li>Monday - Friday (8 hours/day)</li>\r\n	<li>Career developments</li>\r\n	<li>Competitive salary and Homey office</li>\r\n	<li>Allowance and health insurance</li>\r\n	<li>Cofee</li>\r\n	<li>Team building trip</li>\r\n	<li>Training and skill development</li>\r\n	<li>PES 3 LED 40 INCHI, Table Tennis</li>\r\n	<li>Full time position(s)</li>\r\n</ul>', '2 Years of Experience (Supervisor/Coordinator)', 'fulltime', '', '2019-02-04 07:10:49'),
(33, 'UI / UX Designer', '', 'Y', '<ul>\r\n	<li>Candidate must possess at least Diploma, Bachelor&#39;s Degree&nbsp;in any field.</li>\r\n	<li>At least 2 Year(s) of working experience in the related field is required for this position.</li>\r\n	<li>Preferably Staff (non-management &amp; non-supervisor) specialized in IT/Computer - Software or equivalent.</li>\r\n</ul>', '<p><strong>Skill You will Need:</strong></p>\r\n\r\n<ol>\r\n	<li>Motivation to be proactive about new innovations.</li>\r\n	<li>Good verbal and written communication skills.</li>\r\n	<li>An eye for detail and design</li>\r\n	<li>Ability to work unassisted.</li>\r\n	<li>Ability to create modern and contemporary website and mobile app designs</li>\r\n	<li>Wire-framing and prototyping with any products</li>\r\n	<li>Experience with graphical software packages such as Adobe Creative Suite</li>\r\n</ol>', '<p><strong>Responsibilities:</strong></p>\r\n\r\n<ol>\r\n	<li>Creating beautiful intuitive contemporary interfaces and designs.&nbsp;</li>\r\n	<li>Working with our tech directors, project manager, and development team:\r\n	<ul>\r\n		<li>Provide advices and contribute with concept/ideas on design-related area</li>\r\n		<li>Work together to identify, plan and manage graphical ugrades to new existing products.</li>\r\n		<li>Create wireframes, prototype and finished designs in Photoshop or Marvelapps/invision/any other similiar products for new and existing websites and apps.</li>\r\n		<li>Handover the design details and interactions to developers.</li>\r\n		<li>In ad-hoc basis, creating or upgrading the design of material for client presentation.</li>\r\n	</ul>\r\n	</li>\r\n</ol>\r\n\r\n<p><strong>Benefit :</strong></p>\r\n\r\n<ul>\r\n	<li>Monday - Friday (8 hours/day)</li>\r\n	<li>Career developments</li>\r\n	<li>Competitive salary and Homey office</li>\r\n	<li>Allowance and health insurance</li>\r\n	<li>Cofee</li>\r\n	<li>Team building trip</li>\r\n	<li>Training and skill development</li>\r\n	<li>Full time position(s)</li>\r\n</ul>', '2 Years of Experience (Staff (non-management & non-supervisor))', 'fulltime', '', '2019-02-04 07:13:54'),
(34, 'Javascript Developer', '', 'Y', '<ul>\r\n	<li>Candidate must possess at least Diploma, Bachelor&#39;s Degree&nbsp;in any field.</li>\r\n	<li>At least 1&nbsp;Year(s) of working experience in the related field is required for this position.</li>\r\n	<li>Required Skill(s): JavaScript, react, redux, angular, mongoDB, express, nodeJS</li>\r\n	<li>Preferably Less than 1 year experience specialized in IT/Computer - Software or equivalent.</li>\r\n</ul>', '<p><strong>Requirement</strong></p>\r\n\r\n<ol>\r\n	<li>At least 1 years of experience in software development of Javascript technology.</li>\r\n	<li>Have experience use Javascript framework.&nbsp;\r\n	<ul>\r\n		<li>Frontend framework like AngularJS/ReactJS/KnockoutJS, etc.</li>\r\n		<li>Backend framework like nodeJS/ExpressJS/VueJS, etc.</li>\r\n	</ul>\r\n	</li>\r\n	<li>Familiar with unit testing like Jest, Mocha is a plus.</li>\r\n	<li>Experienced with No-SQL, MongoDB</li>\r\n	<li>Good knowledge on developing API and familiar with REST, JSON, etc.</li>\r\n	<li>Experienced with source code management (repository) like GIT is a plus.</li>\r\n	<li>Experienced with agile (SCRUM) software development is a plus.</li>\r\n	<li>Any application published is a big advantage</li>\r\n	<li>Willing to work in Yogyakarta and fulltime</li>\r\n</ol>', '<p><strong>Responsibilities:</strong></p>\r\n\r\n<ol>\r\n	<li>Design and develop application from existing framework</li>\r\n	<li>Adding features to existing applications.</li>\r\n	<li>Debuging and fixing errors.</li>\r\n	<li>Testing of applications and services.</li>\r\n	<li>Discuss and solve problem with team.</li>\r\n	<li>Collaborates with other developer (team)</li>\r\n</ol>\r\n\r\n<p><strong>Benefit :</strong></p>\r\n\r\n<ul>\r\n	<li>Career developments</li>\r\n	<li>Competitive salary and Homey office</li>\r\n	<li>Allowance and health insurance</li>\r\n	<li>Cofee</li>\r\n	<li>Fun room (bean bag, LED TV 40&rdquo;, Playstation 3</li>\r\n	<li>Team building trip</li>\r\n	<li>Flexible working hours (8 hours)</li>\r\n	<li>Training and skill development</li>\r\n	<li>Full time position(s)</li>\r\n</ul>', '1 Year of Experience (Less Than 1 year of experience)', 'fulltime', '', '2019-02-04 07:17:53'),
