(36, 'Human Resource Development (HRD) Staff', '', 'N', '<p><strong>GENERAL</strong></p>\r\n\r\n<ul>\r\n	<li>Candidate must possess at least Bachelor&#39;s Degree in Mass Communications, Psychology, Law or equivalent.</li>\r\n	<li>At least 1&nbsp;Year(s) of working experience in the related field is required for this position.</li>\r\n	<li>Required Skill(s): HRD, Communication, Consulting</li>\r\n	<li>Preferably Staff (non-management &amp; non-supervisor) specialized in Human Resources or equivalent.</li>\r\n</ul>', '<p><strong>REQUIREMENT</strong></p>\r\n\r\n<ul>\r\n	<li>Candidates at least 25 years old</li>\r\n	<li>Preferable experience in HR IT industries at least 1 year</li>\r\n	<li>Experienced with mass communication</li>\r\n	<li>Excelent controlling resources &amp; Standard Operating Procedure (SOP)</li>\r\n	<li>Good looking</li>\r\n	<li>Have a good attitude, good interpersonal skill, good communication, hardwork, proactive.</li>\r\n	<li>Excelent planning, organization abilities and doing personality analisys.</li>\r\n	<li>Have a good service orientation, strong leadership</li>\r\n	<li>Freshgraduate are welcome</li>\r\n</ul>', '<p><strong>RESPONSIBILITIES</strong></p>\r\n\r\n<ul>\r\n	<li>Responsible about recruitment, absences, payroll, evaluation, training &amp; development, and performance resources.</li>\r\n	<li>Maintain employees (data, consulting etc)</li>\r\n	<li>Ensuring that all SOP are implemented well</li>\r\n	<li>Understand about labor law (UU Ketenagakerjaan RI)</li>\r\n</ul>\r\n\r\n<p><strong>BENEFIT</strong></p>\r\n\r\n<ul>\r\n	<li>Career developments</li>\r\n	<li>Competitive salary and Homey office</li>\r\n	<li>Allowance and health insurance</li>\r\n	<li>Cofee</li>\r\n	<li>Fun room (bean bag, LED TV 40&rdquo;, Playstation 3)</li>\r\n	<li>Team building trip</li>\r\n	<li>Table Tennis</li>\r\n	<li>Flexible working hours (8 hours)</li>\r\n	<li>Training and skill development</li>\r\n</ul>', '1 Year of Experience (Staff (non-management & non-supervisor))', 'fulltime', 'urgent', '2019-05-14 03:40:36'),
(37, 'Leads Seeker', '', 'Y', '<p>Jobdesc &amp; Fee :</p>\r\n\r\n<p>&ndash; 1 leads = Rp. 1000</p>\r\n\r\n<p>&ndash; 1 week harus collect 100 leads</p>\r\n\r\n<p>&ndash; 1 month max 425 leads</p>\r\n\r\n<p>&ndash; tidak boleh sama dengan leads sebelum-sebelumnya</p>\r\n\r\n<p>&ndash; 1 week ada kewajiban ngantor 6 jam</p>', '<p>1. Paham Perkembangan Industri IT terutama Startup</p>\r\n\r\n<p>2. Mungkin jurusan IT atau Ilmu Komunikasi</p>\r\n\r\n<p>3. Memiliki Laptop / PC Sendiri</p>', NULL, '(Staff (non-management & non-supervisor))', 'parttime', 'noturgent', '2019-06-20 07:22:51'),
(38, 'Assistant Development Manager', '', 'Y', NULL, '<p>REQUIREMENT<br />\r\n1. Candidate must possess at least a Bachelor&#39;s Degree from Computer Science/Information Technology<br />\r\n2. Freshgraduates are welcome.<br />\r\n3. Having experience as laboratory/lecture assistant<br />\r\n4. Good knowledge in System Analyst, Project Managerial<br />\r\n5. Have a knowledge about programming language, such as PHP, Java, etc.<br />\r\n6. Familiar with RDMS (MySQL, PostgreSQL, Oracle) and no-SQL (MongoDB, etc)<br />\r\n7. Good Logic and teamwork.<br />\r\n8. Have a cool personality.<br />\r\n9. Good communication<br />\r\n10. Preferably female applicants.</p>', '<p><strong>RESPONSIBILITIES</strong></p>\r\n\r\n<ol>\r\n	<li>Work with Project Manager and/or Technical Lead.</li>\r\n	<li>Planning, Monitoring, Execution, and Evaluating project lifecycle / development process.</li>\r\n	<li>Make some document project: SRS, BRD, FSD, etc.</li>\r\n	<li>Looking for an oportunity, make project proposal, etc.</li>\r\n	<li>Collaborate and close contact with tech team, vendor, sales and product owner.</li>\r\n	<li>Collecting and analyse data to support product development.</li>\r\n	<li>Report to stakeholders periodically.</li>\r\n</ol>\r\n\r\n<p><strong>Benefit :</strong></p>\r\n\r\n<ol>\r\n	<li>Salary negotiable dan bonus project (insentive dealing)</li>\r\n	<li>Hari kerja Senin - Jumat, 8 jam kerja (jam masuk fleksibel</li>\r\n	<li>Tunjangan kesehatan, THR, bonus KPI</li>\r\n	<li>Jenjang karir</li>\r\n	<li>Kopi, funroom, snack</li>\r\n</ol>', '1 Year of Experience (Manager/Assistant Manager)', 'fulltime', 'urgent', '2019-09-04 03:23:17'),
(39, 'DevOps Engineer', '', 'Y', '<p>&nbsp;</p>\r\n\r\n<ul>\r\n</ul>', '<p>Requirement:</p>\r\n\r\n<ul>\r\n	<li>Bachelor&rsquo;s degree in computer science, engineering or related field</li>\r\n	<li>Have minimun 1 years working experience in similar position</li>\r\n	<li>Experienced with AWS</li>\r\n	<li>Familiarity with SQL Server Database</li>\r\n	<li>Strong kowledge in computer networking (IP, DNS,HTTP(S))</li>\r\n	<li>Experience with monitoring system and strategies</li>\r\n	<li>Contribute to open source project and participate in technical communities</li>\r\n	<li>A stong inner motivation and positive attitude</li>\r\n	<li>Abble to work independently and with teams</li>\r\n	<li>Placement yogyakarta</li>\r\n</ul>', '<p>Responsibilities:</p>\r\n\r\n<ul>\r\n	<li>Running DevOps Activities</li>\r\n	<li>Working closely with engineer team</li>\r\n	<li>Prepare, set up and manage DevOps</li>\r\n	<li>Establish system specifications</li>\r\n</ul>\r\n\r\n<p><strong>Benefits</strong></p>\r\n\r\n<ul>\r\n	<li>Monday - Friday (8 hours/day)</li>\r\n	<li>Career developments</li>\r\n	<li>Competitive salary and Homey office</li>\r\n	<li>Allowance and health insurance</li>\r\n	<li>Cofee</li>\r\n	<li>Team building trip</li>\r\n	<li>Training and skill development</li>\r\n	<li>Full time position(s)</li>\r\n</ul>', '1 Year of Experience (Staff (non-management & non-supervisor))', 'fulltime', 'urgent', '2019-09-17 10:13:31'),
(40, 'WordPress Developer', '', 'Y', NULL, '<p>Requirements:<br />\r\n&bull;&nbsp;&nbsp; &nbsp;At least 1 year experience with PHP, SQL, CI, Laravel and Javasciript, preferably using WordPress<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Self motivated, Hardworking, hightly responsible<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Comfortable working with overseas clients<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Able to work in a team<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Placement Yogyakarta</p>', '<p>Responsibilities:<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Building application in PHP and WordPress<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Concept and develop website interface &amp; mock-ups&nbsp;<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Develop interactive graphic layout for web&nbsp;<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Develop, enhance, and maintain client website&nbsp;<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Entry Data on Client Website</p>\r\n\r\n<p><strong>Benefits</strong></p>\r\n\r\n<ul>\r\n	<li>Monday - Friday (8 hours/day)</li>\r\n	<li>Career developments</li>\r\n	<li>Competitive salary and Homey office</li>\r\n	<li>Allowance and health insurance</li>\r\n	<li>Cofee</li>\r\n	<li>Team building trip</li>\r\n	<li>Training and skill development</li>\r\n	<li>Full time position(s)</li>\r\n</ul>', '1 Year of Experience (Staff (non-management & non-supervisor))', 'fulltime', 'urgent', '2019-09-18 03:32:12'),
(41, 'International Implementation Consultant', '', 'Y', '<ul>\r\n	<li>Candidate must possess at least Diploma, Bachelor&#39;s Degree in Computer Science/Information Technology or equivalent.</li>\r\n	<li>At least 1 Year(s) of working experience in the related field is required for this position. Fresh graduate are welcome.</li>\r\n	<li>Preferably Staff (non-management &amp; non-supervisor) specialized in IT/Computer - Software or equivalent.</li>\r\n	<li>Full time position</li>\r\n	<li>Willing work to Jakarta</li>\r\n</ul>', '<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li>Familiar with client side scripting languages and technologies such as Javascript and AJAX</li>\r\n		<li>Familiar with server side web based scripting languages such as ColdFusion, PHP or ASP</li>\r\n		<li>Good communication in English.</li>\r\n		<li>Good presentation skill.</li>\r\n		<li>Ability to understand client requirements to technical specifications and communicate to technical staff</li>\r\n		<li>Proven client facing skills</li>\r\n		<li>Excellent communication skills, including verbal, written, interpersonal and presentation in English</li>\r\n		<li>Willing to International trips to clients, such as Thailand, Malaysia, Singapore, Philippine</li>\r\n	</ul>\r\n	</li>\r\n</ul>', '<p><strong>Benefits</strong></p>\r\n\r\n<ul>\r\n	<li>Monday - Friday (8 hours/day)</li>\r\n	<li>Career developments</li>\r\n	<li>Competitive salary and Homey office</li>\r\n	<li>Allowance and health insurance</li>\r\n	<li>Coffee</li>\r\n	<li>Team building trip</li>\r\n	<li>Training and skill development</li>\r\n	<li>Full time position(s)</li>\r\n</ul>', '2 Years of Experience (Staff (non-management & non-supervisor))', 'fulltime', 'noturgent', '2019-11-28 02:51:15'),
(42, 'Database Administrator', '', 'Y', '<ul>\r\n	<li>Candidate must possess at least Diploma, Bachelor&#39;s Degree in Computer Science/Information Technology or equivalent.</li>\r\n	<li>At least 1 Year(s) of working experience in the related field is required for this position. Fresh graduate are welcome.</li>\r\n	<li>Preferably Staff (non-management &amp; non-supervisor) specialized in IT/Computer - Software or equivalent.</li>\r\n	<li>Full time position</li>\r\n	<li>Willing work to Jakarta</li>\r\n</ul>', '<ul>\r\n	<li>Responsible for the administration and support of various database systems used by the company</li>\r\n	<li>Installation and management of the MS SQL and MariaDB Database running on Linux and Windows servers</li>\r\n	<li>The management of associated Data Warehouse environment</li>\r\n	<li>Managing application maintenance support activities, such as upgrade and patch installations, database account maintenance, database performance tuning, database backup and recovery, database security, system and database monitoring, and capacity planning</li>\r\n</ul>', '<p><strong>Benefits</strong></p>\r\n\r\n<ul>\r\n	<li>Monday - Friday (8 hours/day)</li>\r\n	<li>Career developments</li>\r\n	<li>Competitive salary and Homey office</li>\r\n	<li>Allowance and health insurance</li>\r\n	<li>Cofee</li>\r\n	<li>Team building trip</li>\r\n	<li>Training and skill development</li>\r\n	<li>Full time position(s)</li>\r\n</ul>', '1 Year of Experience (Staff (non-management & non-supervisor))', 'fulltime', 'noturgent', '2019-11-28 02:52:10'),
(43, 'International Project Manager', '', 'Y', '<ul>\r\n	<li>Candidate must possess at least Diploma, Bachelor&#39;s Degree in Computer Science/Information Technology or equivalent.</li>\r\n	<li>At least 1 Year(s) of working experience in the related field is required for this position. Fresh graduate are welcome.</li>\r\n	<li>Preferably Staff (non-management &amp; non-supervisor) specialized in IT/Computer - Software or equivalent.</li>\r\n	<li>Full time position</li>\r\n	<li>Willing work to Jakarta</li>\r\n</ul>', '<ul>\r\n	<li>\r\n	<ul style=\"list-style-type:disc\">\r\n		<li>Familiar with client side scripting languages and technologies such as Javascript and AJAX</li>\r\n		<li>Familiar with server side web based scripting languages such as ColdFusion, PHP or ASP</li>\r\n		<li>Have knowledge on business process and analysis.</li>\r\n		<li>Good communication in English.</li>\r\n		<li>Good presentation skill.</li>\r\n		<li>Posses good level of result driving, analytical thinking and decision making.</li>\r\n		<li>Have strong technological skills and ability to learn task-management software such as TeamworkPM, Jira, Microsoft Project, or an equivalent.</li>\r\n		<li>Willing to International trips to clients, such as Thailand, Malaysia, Singapore, Philippine</li>\r\n	</ul>\r\n	</li>\r\n</ul>', '<p><strong>Benefits</strong></p>\r\n\r\n<ul>\r\n	<li>Monday - Friday (8 hours/day)</li>\r\n	<li>Career developments</li>\r\n	<li>Competitive salary and Homey office</li>\r\n	<li>Allowance and health insurance</li>\r\n	<li>Cofee</li>\r\n	<li>Team building trip</li>\r\n	<li>Training and skill development</li>\r\n	<li>Full time position(s)</li>\r\n</ul>', '1 Year of Experience (Supervisor/Coordinator)', 'fulltime', 'noturgent', '2019-11-28 02:53:08'),
(44, 'IT Application Support', '', 'Y', '<ol>\r\n	<li>Candidate must possess at least Diploma, Bachelor&#39;s Degree in any field.</li>\r\n	<li>At least 1 Year(s) of working experience in the related field is required for this position.</li>\r\n	<li>Preferably Staff (non-management &amp; non-supervisor) specialized in IT/Computer - Software or equivalent.</li>\r\n</ol>', '<ul>\r\n	<li>At least 1 years of experience in IT Industries&nbsp;</li>\r\n	<li>Knowing about data analytics</li>\r\n	<li>Mastering My SQL, Ms. SQL Server.</li>\r\n	<li>Prefer has understanding in Javascript</li>\r\n	<li>Life Asia (Diagnose problem or Troubleshoot as Application support)</li>\r\n</ul>', '<p><strong>Benefits</strong></p>\r\n\r\n<ul>\r\n	<li>Monday - Friday (8 hours/day)</li>\r\n	<li>Career developments</li>\r\n	<li>Competitive salary and Homey office</li>\r\n	<li>Allowance and health insurance</li>\r\n	<li>Cofee</li>\r\n	<li>Team building trip</li>\r\n	<li>Training and skill development</li>\r\n	<li>Full time position(s)</li>\r\n</ul>', '1 Year of Experience (Staff (non-management & non-supervisor))', 'fulltime', 'noturgent', '2019-11-28 03:27:32'),
(45, 'IT Manager', '', 'Y', '<ul>\r\n	<li>Candidate must possess at least a Bachelor&#39;s Degree from Computer Science/Information Technology</li>\r\n	<li>Minimum 1 year experience as IT Project Manager</li>\r\n</ul>', '<p>&nbsp;</p>\r\n\r\n<p>REQUIREMENT</p>\r\n\r\n<ul>\r\n	<li>\r\n	<ul>\r\n		<li>Candidate must possess at least a Bachelor&#39;s Degree from Computer Science/Information Technology</li>\r\n		<li>Minimum 1 year experience as IT Project Manager</li>\r\n		<li>Have programming skills on any languages and frameworks</li>\r\n		<li>Active in any organization is a must</li>\r\n		<li>Good leadership, team management and problem solver</li>\r\n		<li>Good attitude and good communication (especially on business communication)</li>\r\n		<li>Able to do any innovation</li>\r\n		<li>Aware with IT industries and IT development</li>\r\n		<li>For fulltime position</li>\r\n		<li>Can join as soon as possible (ASAP)</li>\r\n	</ul>\r\n	</li>\r\n</ul>', '<p><strong>Benefits</strong></p>\r\n\r\n<ul>\r\n	<li>Monday - Friday (8 hours/day)</li>\r\n	<li>Career developments</li>\r\n	<li>Competitive salary and Homey office</li>\r\n	<li>Allowance and health insurance</li>\r\n	<li>Coffee</li>\r\n	<li>Team building trip</li>\r\n	<li>Training and skill development</li>\r\n	<li>Full time position(s)</li>\r\n</ul>', '1 Year of Experience (Manager/Assistant Manager)', 'fulltime', 'urgent', '2019-12-17 06:45:47'),
(46, 'Graphic Designer', '', 'Y', '<p>1. Required Skills: 3DSMax / Maya, Photoshop<br />\r\n2. At least 1 year experience specialized in 3D field<br />\r\n3. Eager to learn, hard-working, work under pressure, and high attention in details<br />\r\n4. Able to make Modelling, Texturing, Rigging, Animating, and Rendering<br />\r\n5. Good work ethic and pleasant attitude</p>', '<p>1. Required Skills: 3DSMax / Maya, Photoshop<br />\r\n2. At least 1 year experience specialized in 3D field<br />\r\n3. Eager to learn, hard-working, work under pressure, and high attention in details<br />\r\n4. Able to make Modelling, Texturing, Rigging, Animating, and Rendering<br />\r\n5. Good work ethic and pleasant attitude</p>', NULL, '1 Year of Experience (Staff (non-management & non-supervisor))', 'fulltime', 'noturgent', '2020-01-13 03:34:12'),
(47, 'DATA ENGINEER', '', 'Y', '<ul>\r\n	<li>Minimum 1 year of experience in a Data Engineer role (Fresh Graduates are welcome)</li>\r\n	<li>Degree in computer science/engineering/mathematics is a good start, but not a must</li>\r\n	<li>Having familiarity with ETL Tools (Talend/Pentaho/Informatica)</li>\r\n	<li>Understanding in database operation, management and design (SQL)</li>\r\n	<li>Excellent communication skills and analytical thinking</li>\r\n	<li>Not scared of reading technical documentation or source code.</li>\r\n	<li>Willing to work ASAP in Jakarta (fulltime)</li>\r\n</ul>', NULL, '<ul>\r\n	<li>Monday - Friday (8 hours/day)</li>\r\n	<li>Career developments</li>\r\n	<li>Competitive salary and Homey office</li>\r\n	<li>Allowance and health insurance</li>\r\n	<li>Cofee</li>\r\n	<li>Team building trip</li>\r\n	<li>Training and skill development</li>\r\n	<li>Full time position(s)</li>\r\n</ul>', '1 Year of Experience (Staff (non-management & non-supervisor))', 'fulltime', 'urgent', '2020-01-30 06:23:26'),
(48, 'INFRASTRUCTURE ENGINEER', '', 'Y', '<ul>\r\n	<li>Candidate must posses at least Bachelor Degree in Engineering (Computer/Information Technology) or equivalent</li>\r\n	<li>At least 2 Year(s) of working experience in the related field is required for this position.</li>\r\n	<li>Familiar with Vulnerability Assessment, Penetration Testing.</li>\r\n	<li>Having familiarity to setup hadoop cluster (cloudera, mapr, HDP)</li>\r\n	<li>Willing to work ASAP in Jakarta (fulltime)</li>\r\n</ul>', NULL, '<ul>\r\n	<li>Monday - Friday (8 hours/day)</li>\r\n	<li>Career developments</li>\r\n	<li>Competitive salary and Homey office</li>\r\n	<li>Allowance and health insurance</li>\r\n	<li>Cofee</li>\r\n	<li>Team building trip</li>\r\n	<li>Training and skill development</li>\r\n	<li>Full time position(s)</li>\r\n</ul>', '1 Year of Experience (Staff (non-management & non-supervisor))', 'fulltime', 'urgent', '2020-01-30 06:24:26'),
(49, 'BUSINESS INTELLIGENCE', '', 'Y', '<ul>\r\n	<li>Minimum bachelor degree on Computer Science, Information System or Information Technology</li>\r\n	<li>Fresh Graduates are most welcome and if have working experience will be an advantage</li>\r\n	<li>Experience with BI tools (Tableau, Power BI, QlikView etc) will be an advantage</li>\r\n	<li>Strong Analytical skills and proficient data management skills</li>\r\n	<li>Deep understanding of Business Intelligence and Data Warehouse architecture</li>\r\n	<li>Pro-active, capable self-motivated and able to work independent</li>\r\n	<li>Willing to work ASAP in Jakarta (fulltime)</li>\r\n</ul>', NULL, '<ul>\r\n	<li>Monday - Friday (8 hours/day)</li>\r\n	<li>Career developments</li>\r\n	<li>Competitive salary and Homey office</li>\r\n	<li>Allowance and health insurance</li>\r\n	<li>Cofee</li>\r\n	<li>Team building trip</li>\r\n	<li>Training and skill development</li>\r\n	<li>Full time position(s)</li>\r\n</ul>', '1 Year of Experience (Staff (non-management & non-supervisor))', 'fulltime', 'urgent', '2020-01-30 06:25:33'),
(50, 'Data Scientist', '', 'Y', '<p>Excellent analytical and problem-solving skills.</p>\r\n\r\n<p>At least 2 year experience as a Data Scientist/Engineer.</p>\r\n\r\n<p>You possess a Master in Mathematics, Statistics, Computer Science or related field from reputable university</p>', '<p>Expertise in Natural Language Processing/Text Mining and/or Artificial Intelligence.</p>\r\n\r\n<p>Familiarity with Amazon Web Services.</p>\r\n\r\n<p>Possess strong knowledge of Python or R.</p>\r\n\r\n<p>Be comfortable working with Linux and Shell.</p>\r\n\r\n<p>Great at data preparation.</p>\r\n\r\n<p>&nbsp;</p>', '<ul>\r\n	<li>Monday - Friday (8 hours/day)</li>\r\n	<li>Career developments</li>\r\n	<li>Competitive salary and Homey office</li>\r\n	<li>Allowance and health insurance</li>\r\n	<li>Cofee</li>\r\n	<li>Team building trip</li>\r\n	<li>Training and skill development</li>\r\n	<li>Full time position(s)</li>\r\n</ul>', '2 Years of Experience (Staff (non-management & non-supervisor))', 'fulltime', 'urgent', '2020-03-31 02:14:32'),
(51, 'Software Developer', '', 'Y', '<ul>\r\n	<li>Minimal pendidikan D3/S1 Teknologi Informasi</li>\r\n	<li>Good attitude and have responsibilities</li>\r\n	<li>Can work as teams and individual</li>\r\n</ul>', '<ul>\r\n	<li>Diutamakan memiliki pengalaman 1 tahun di bidang IT Support</li>\r\n	<li>Menguasai salah satu dari bahasa pemrograman berikut: PHP, Java, atau NodeJS</li>\r\n	<li>Mengerti Postgre SQL</li>\r\n	<li>Menguasai Postman</li>\r\n	<li>Terbiasa dengan konsep API</li>\r\n	<li>Bersedia ditempatkan di Jakarta</li>\r\n</ul>', '<ul>\r\n	<li>Membantu proses integrasi merchant</li>\r\n	<li>Debugging di level development / staging</li>\r\n	<li>Improvement dokumentasi teknis produk</li>\r\n	<li>Membantu proses closing ke prospek merchant</li>\r\n</ul>', '1 Year of Experience (Staff (non-management & non-supervisor))', 'fulltime', 'urgent', '2020-04-09 02:20:01');
