(340, 10653, 'Web Application', 'Web application to provide management internal and external. PEPS-Internal to help management to\r\nmanage all data and report to SAP. PEPS-External to help management to get potential vendor to sharing project. Develop system to integrated to SAP.', '.NET MVC', NULL, '', '2020-04-06 09:39:42', NULL, 'pribadi', 'Petronas Carigali Muriad, Ltd', 'April 2019', 'Juni 2019'),
(341, 10630, 'Company Profile', '- company profile website that aims to promote warehouse rental / sale.\r\n- The website contains information about the company, and the building gallery which is traded', 'php version 7 & bootstrap version 3', NULL, '', '2020-04-07 10:45:17', '2020-04-07 11:22:43', 'pribadi', 'BlueSky Warehouse Property', 'Maret 2018', 'April 2018'),
(342, 10630, 'Inventory Management', '- create a web-based application, which aims to record and manage in and out of goods in the warehouse and provide monthly reports that can be filtered by the date and item code.', 'laravel framework version 5.5 & bootstrap version 4', NULL, '', '2020-04-07 10:54:04', '2020-04-07 11:24:40', 'pribadi', 'PT Bintang Usaha Nasional', 'April 2018', 'Agustus 2018'),
(343, 10630, 'Expense System', '- a web-based application, which aims to record and manage employee travel expenses. This application includes user management, with a hierarchy of positionswhich affects the travel allowance and taxes that are levied. Budget provided, among othersincludes hotel, food and employee transportation costs during service. This application is divided by 2 large modules travel advance and cash advance, travel advance is the filing of travel costs, while cash advanceis a submission for accommodation costs or unexpected costs. In this project, my job is to create REST API to consumed by mobile app.', '.Net framework version 4.x, Sencha ExtJS version 4.x, SQL Server 2008 R2, SQL Server Management 2014, Postman', NULL, '', '2020-04-07 10:57:33', '2020-04-07 11:23:32', 'pribadi', 'Bank EksporImpor Indonesia', 'Mei 2019', 'November 2019'),
(344, 10630, 'Bussiness Process Management Software', '- Create a web-based application, which aims to record and manageordering and calculation of chemical budgets.\r\n- This application also provides a chemical testing process, and a report of the test results.\r\nin addition, this application provides a calibration recording service for chemicals, as well as assembly. - and also this application provides consulting services for its customers.\r\n- and finally this application includes inventory management services for managing chemical equipment.', '.Net framework version 4.x, Sencha ExtJS version 4.x, SQL Server 2008 R2, SQL Server Management 2014', NULL, '', '2020-04-07 11:03:16', NULL, 'pribadi', 'PT Unilab Perdana', 'Mei 2019', 'April 2000'),
(345, 10630, 'Robo Advisor', '- Mobile application that is useful for making stock / mutual fund recommendations that are suitable for consumers.\r\n- This application calculates and processes the amount of money entered by the user, which is divided into several stages.\r\n- the first stage, the user chooses \"Life Goals\" such as, vacation, marriage, retirement, etc.\r\n- then the user is asked to enter fixed income per month and the amount he wants to invest.\r\n- then the user is asked to choose the characteristics of their investment, whether they are included in the category of aggressive or moderate in investing.\r\n- and the application will provide stock / mutual fund recommendations for users to buy, after that the application will issue an investment simulation and the return to be obtained in the next few years. In this project, my job is creating REST API to consumed by mobile and web CMS app.', '.Net core 3.1, postman, SQL Server Management Studio 2014, SQL Server 2008 R2', NULL, '', '2020-04-07 11:19:49', NULL, 'pribadi', 'Alpha HQ', 'Januari 2020', 'April 2000'),
(346, 10988, 'LGC Microservice Accounting and HR', 'this is a project combining and translating from ERP and third party data from MOKA\'s point of\r\nsale (POS) for HR and accounting applications(client side)', 'Laravel, Lumen, Ajax, Javascript, CSS, MySQL/Maria DB, Adobe Dreamweaver/Sublime/Notepad++, XAMPP, Postman', NULL, '', '2020-04-09 14:33:36', NULL, 'kantor', 'PT Asclar Indonesia', 'Februari 2020', 'Maret 2020'),
(347, 10988, 'Travel helper', 'Travel helper is customer to customer (C2C) E-commerce. This is an application for the travel agent selling the travel products(attraction, tour , transport etc) for traveler .', 'PHP, JQuery,Javascript , Ajax, SQL, MySQL/Maria DB, Adobe Dreamweaver/Sublime/Notepad++\r\nXAMPP, Postman', NULL, '', '2020-04-09 14:36:16', NULL, 'kantor', 'PT Magkna Bhakti Informasi', 'November 2018', 'Oktober 2019'),
(348, 10988, 'Android App: Health Management', 'Health Management is an application for the patient who needs save their medical record. Then, the patient can calling their doctor for consulting about it.', 'Java , PHP Framework for REST API, MYSQL, Postman, XAMPP, Text Editor', NULL, '', '2020-04-09 14:39:35', NULL, 'kantor', 'PT Magkna Bhakti Informasi', 'November 2018', 'April 2019'),
(349, 10988, 'HRIS Project', 'HRIS is a software or online application for data entry, tracking data and information sources for\r\nHR, payroll, management and accounting departments for the company', 'PHP, JQuery, MySQL/Maria DB, Adobe Dreamweaver/Sublime/Notepad++, XAMPP', NULL, '', '2020-04-09 14:41:16', NULL, 'kantor', 'PT Magkna Bhakti Informasi', 'September 2018', 'Desember 2018'),
(350, 11199, 'Wakuliner - Culinary Marketplace', 'Analyzing technical requirement for new features, merging new functions with the existing application architecture, bug hunting and fixing, designing and integrating API with backend team, adding security measures in API transactions', 'Java, Firebase', NULL, '', '2020-04-17 11:13:05', NULL, 'kantor', 'Wakuliner', 'Mei 2018', 'Mei 2020'),
