(78, 30, 'Senior Fullstack Web Developer', 'Fs Web - Jakarta', '', '• Merancang dan melakukan analisis terhadap kebutuhan data yang saling berkomunikasi dengan memilih salah satu konsep implementasi (seperti SOAP, REST atau XML-RPC).\r\n• Merancang, mengimplementasikan dan memelihara fase pengembangan aplikasi.\r\n• Terlibat dalam kegiatan pengembangan dan perancangan arsitektur perangkat lunak aplikasi.\r\n• Melakukan analisis perangkat lunak, kode pemrograman, pengujian dan debugging.\r\n• Mengidentifikasi masalah aplikasi pada fase production dan development.\r\n• Memberikan hasil analisis dan merekomendasikan perubahan untuk meningkatkan proses eksekusi/running aplikasi.', '2019-11-27', 12, 12, '2', 'prepare', NULL, NULL, '2019-11-27 14:34:32'),
(79, 31, '', 'TEST REQUEST', '', 'LOREM IPSUM LOH', '2019-11-12', 3, 1, '1', 'active', 'INI QUESTION LOH', NULL, '2019-11-27 14:37:42'),
(80, 30, '', 'HYBRID MOBILE - JKT', '', '\"• Merancang, mengimplementasikan dan memelihara fase pengembangan aplikasi.\r\n• Dapat mengintegrasikan web services kedalam aplikasi berbasis mobile baik Android maupun iOS.\r\n• Terlibat dalam kegiatan pengembangan dan perancangan arsitektur perangkat lunak aplikasi untuk platfom berbasis Android dan iOS\r\n• Melakukan analisis perangkat lunak, kode pemrograman, pengujian dan debugging.\r\n• Mengidentifikasi masalah aplikasi pada fase production dan development.\r\n• Memberikan hasil analisis dan merekomendasikan perubahan untuk meningkatkan proses eksekusi/running aplikasi.\"', '2019-11-27', 12, 12, '2', 'prepare', NULL, NULL, '2019-11-27 14:37:53'),
(81, 30, '', 'IT Security -JKT', '', '\"• Melakukan pengujian keamanan aplikasi.\r\n• Melakukan pengujian penetrasi aplikasi secara teratur.\r\n• Memberikan solusi teknis untuk operasi tim pengembangan perangkat lunak dengan tujuan mengurangi temuan terkait keamanan dan celah aplikasi.\r\n• Melakukan kegiatan keamanan terjadwal berdasarkan konsep IS027001 dan PCI-DSS\r\n• Mempertahankan informasi terkini tentang kerentanan keamanan terbaru dan rencana dokumen tentang proses mitigasi.\r\n• Membuat laporan tentang insiden keamanan dan / atau temuan keamanan.\"', '2019-11-27', 4, 4, '2', 'prepare', NULL, NULL, '2019-11-27 14:38:55'),
(83, 32, 'Web Developer', 'WD - JKT', 'PHP', 'Specialized in one or more back-end programming language (PHP/Java/Node.Js/etc)\r\n- Knowledge in IT infrastructure (server, security, data warehouse) is a huge plus\r\n: Deep understanding of microservice architecture', '2019-11-27', 12, 1, '2', 'prepare', NULL, NULL, '2019-11-27 14:42:34'),
