(89, 35, 'Web Developer', 'WD - JKT', '', '•	IT executives with great interests in becoming web developer\r\n•	Minimum 3 - 5 years working experience in a similar role.\r\n•	Demonstrable (intermediate to advanced) skills in the following: PHP, HTML5, MySQL, jQuery, AJAX, NodeJS, .NET, python\r\n•	Good knowledge on the latest UI/UX techniques the industry and first hand experience of a web app user interface methods and trends\r\n•	Good knowledge in integration with third party systems\r\n•	Good knowledge in Design Pattern Programming\r\n•	Good knowledge in OOP & TDD\r\n•	Must have knowledge in the following: API, JSON, HTTP and RESTful web services\r\n•	Team player and great collaborator, pays high attention to detail and able to work independently with minimum supervision\r\n•	Able to communicate effectively in both  English\r\n•	Able to work with geographically distributed project colleagues\r\n•	Knowledge or strong interest in the following area would be advantageous: \r\no	Mobile payments / m-Commerce\r\no	Commerce based applications such as ERP, Accounting, Point of Sale, e-Commerce, Loyalty & Redemption systems etc.\r\no	SCRUM Agile Software Development', '2019-12-11', 12, 1, '2', 'prepare', NULL, NULL, '2019-12-11 12:39:38'),
